import React from 'react';
import Card from '../UI/Card';
import './UsersList.css';
const UsersList = props => {
	return (
		<Card name='users'>
			<ul>
				{props.user.map(user => {
					<li>user.name ({user.age}) years old</li>;
				})}
			</ul>
		</Card>
	);
};

export default UsersList;
